    false,nt"url": null,nt"notes": "This annual narrative report for Great
    Meadows National Wildlife Refuge outlines Refuge accomplishments during July 1993.
    The report begins with a summary of the month's highlights and weather conditions.
    Refuge administration is outlined; information about personnel, volunteer programs,
    and safety is given. Habitat management is also covered; subjects include wetlands.
    The wildlife section of the report discusses waterfowl, marsh birds and waterbirds,
    raptors, other migratory birds and other resident wildlife. The public uses of the
    Refuge described in this report include outdoor classrooms, interpretive programs,
    wildlife observation, and law enforcement. The equipment and facilities section
    of the report provides information about rehabilitation.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
